import React from 'react';

export default () => {
  return (
    <div>
      <h1 className="display-4">About Users</h1>
      <p className="lead">
        Small application that shows the list of users. It's possible to add,
        update or delete a user.
      </p>
      <p className="text-secondary">Version 1.0.0</p>
    </div>
  );
};
